        metadata = {
            'model_id': model_id,
            'inference_timestamp': datetime.utcnow().isoformat(),
            'n_samples': trace.posterior.dims['draw'],
            'n_chains': trace.posterior.dims['chain'],
            'variables': list(trace.posterior.data_vars),
            'access_tier': access_tier,
            'trace_encrypted': True,
            'summary_signed': True
        }

